import React, { Component } from 'react';
import icon from './ShoppingCartIcon.png';
import './NewOrder.scss';

class NewOrder extends React.Component {
  render() {
    return (
      <div className="WidgetWrapper">
        <div className="Header">
          <h4>Shopping Cart</h4>
          <img className="icon" src={icon}></img>
          <span className="btn btn-primary">View</span>
        </div>
        <div className="filters">
          <h6>Quick Product Entry</h6>
          <div className="row">
            <div class="col-sm-2"><label for="Product Code">Product Code</label><br /> 
            <input type="text" name="email" /> </div>
            <div class="col-sm-2"><label for="email">Email</label><br /> 
            <input type="text" name="email" /> </div>
            <div class="col-sm-2"><label for="email">Email</label><br /> 
            <input type="text" name="email" /> </div>
            <div class="col-sm-2"><label for="email">Email</label><br /> 
            <input type="text" name="email" /> </div>

          </div>
        </div>




      </div>

    )
  }

}



export default NewOrder;
